Eh ce l'abbiamo fatta, hai visto che non é fallito subito? Più o meno...
Oggi parliamo di una recensione, ma non una recensione qualsiasi..macché, parleremo di un film prodotto nel 2010 dalla Asylum. Per chi sano di mente non sa cos'è Asylum é una società specializzata in film a basso costo dove gli effetti speciali sono scadenti e la recitazione peggio ancora.Ecco quindi perché oggi andrò a recensire il seguito di Titanic, perché si...hanno girato Titanic II ma non avete idea..di cosa vi aspetterà.
Il film inizia con un surfista che decide di cavalcare delle onde IN MEZZO ALL'OCEANO (Ma nella spiaggia non era meglio?) per non farsi mancare nulla usa come onde i pezzi di ghiaccio di un iceberg che cadevano in acqua e la ciliegina sulla torta? Si stacca un pezzo di ghiaccio enorme che fa alzare un'onda anomala che uccide il surfista.
Qualche mese dopo viene varata una nuova nave da crociera chiamata "Titanic II" e parte per il suo viaggio inaugurale (con effetti rivedibile e un inizio ehm..strano ma ok) con la stessa rotta del "Titanic". Durante la traversata, gli effetti del riscaldamento globale causano il collasso di un ghiacciaio creando uno tsunami che fa sbattere un iceberg contro il "Titanic II". L'intero lato della nave è distrutto e inizia ad affondare (Anche se sembra intatta). Quando il livello dell'acqua inizia a salire, le turbine esplodono, causando un enorme incendio all'interno della nave e vediamo i protagonist bloccati in un ASCENSORE (perché giustamente la nave sta affondando e tu usi l'ascensore per muoverti...quanto sbagliato questo film!). Nel frattempo i protagonisti escono dell'ascensore a caso ma una ragazza che era con lei viene schiacciata (la stessa per la quale erano rimasti sulla nave a cercarla...). Con la maggior parte della nave allagata, i passeggeri morti, il "Titanic II" affonda definitivamente.
I protagonisti Hayden Walsh e Amy sopravvivono ma avendo una sola bombola di ossigeno, Hayden la dà ad Amy e lui muore!😂Quindi...questa puntata finisce qui, direi solo una cosa😂se mi volete bene apprezzate lo sforzo, perché ho un'attacco di nervosismo ora a vedere certi film🤣";}i:199;a:1:{s:14:"comments_count";i:1;}i:200;a:1:{s:11:"likes_count";i:0;}i:201;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuW1K1FfQW";}i:202;a:1:{s:5:"image";s:248:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118604745_317462809342572_6456047022325464426_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=100&_nc_ohc=iuIUdfKUmEoAX-W1bQj&_nc_tp=18&oh=5344c23d5f648c35b56b1bab813f25de&oe=5F7BA8A3";}i:203;a:1:{s:4:"type";s:5:"image";}i:204;a:1:{s:8:"owner_id";i:39058432778;}i:205;a:1:{s:14:"owner_username";s:0:"";}i:206;a:1:{s:14:"owner_fullname";s:0:"";}i:207;a:1:{s:9:"owner_pic";s:0:"";}i:208;a:1:{s:2:"id";s:19:"2390948814493745493";}i:209;a:1:{s:10:"short_code";s:11:"CEuW0dsCoFV";}i:210;a:1:{s:12:"created_time";i:1599243331;}i:211;a:1:{s:7:"caption";s:623:"Quand la convivialité doit laisser place à la réflexion, on ne sait plus vraiment où laisser tendre son coeur. 
